import React from 'react';
import{
  BrowserRouter as Router,
  Routes,
  Route
  }
  from "react-router-dom"
import './App.css';
import ProductsListPage from './pages/ProductsListPage';

function App() {
  return (
      <Router>
         <div className="App">
            <Routes>
              <Route 
                path = "/" 
                exact element = {<ProductsListPage/>}>
              </Route>
            </Routes>
          </div>
      </Router>


  );
}

export default App;
